import { Box } from "@material-ui/core";
import classes from "./PersonalProfile.module.css";

var bgColors = {
  Red: "#CC0000",
};

function PersonalProfile() {
  return (
    <div>
      <Box
        className={classes.box}
        bgcolor="white"
        width={400}
        height={250}
        sx={{ borderColor: "primary.main" }}
      >
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.amazon.in%2FProfessional-Cartoon-Portfolio-Straight-Brunette%2Fdp%2FB07H7GXKSC&psig=AOvVaw2I8zd1QLrZ-6izEoDDhHKe&ust=1635901588975000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCKCVkLy--PMCFQAAAAAdAAAAABAD"></img>
        <p>
          So May See Macy <br />
          Computer Science Major <br />
          Current Standing: Sophomore <br />
          GPA: 3.6
        </p>
      </Box>
      <Box
        className={classes.topbar}
        bgcolor="darkgrey"
        width={400}
        height={50}
      >
        <h2>BU ID: U12-34-5678</h2>
      </Box>
      <Box
        className={classes.bottombar}
        width={400}
        height={50}
        style={{ backgroundColor: bgColors.Red }}
      >
        <h3>View More</h3>
      </Box>
    </div>
  );
}

export default PersonalProfile;
